function App() {
  const days = new Date().getTime();
  const daysSince = days / (1000 * 60 * 60 * 24);

  const birthday = new Date(2022, 4, 5).getTime() / (1000 * 60 * 60 * 24);
  const daysLeft = daysSince - birthday;

  return (
    <div>
      <h2>{daysLeft}</h2>
    </div>
  );
}

export default App;
